import { Table } from "antd"
const dataSource = [
    {
      key: '1',
      scriptCode: '胡彦斌',
      scriptName: 32,
      runningState: '西湖区湖底公园1号',
      theResults:"成功",
      lastRunTime:"11-0-1"
    },
    {
      key: '2',
      scriptCode: '胡彦祖',
      scriptName: 42,
      runningState: '西湖区湖底公园1号',
      theResults:"成功",
      lastRunTime:"11-0-1"
    },
  ];

  const columns = [
    {
      title: '脚本编号',
      dataIndex: 'scriptCode',
      key: 'scriptCode',
    },
    {
      title: '脚本名称',
      dataIndex: 'scriptName',
      key: 'scriptName',
    },
    {
      title: '运行状态',
      dataIndex: 'runningState',
      key: 'runningState',
    },
    {
        title: '运行结果',
        dataIndex: 'theResults',
        key: 'theResults',
    },
    {
        title:"上次运行时间",
        dataIndex:"lastRunTime",
        key:"lastRunTime"
    },
    {
        dataIndex:"tunButton",
        key:"tunButton"
    },
    {
        dataIndex:"open",
        key:"open"
    }
  ];


function AutomaticInvestment () {
    return (
        <Table dataSource={dataSource} columns={columns} />
    )
}

export default AutomaticInvestment
